import React from 'react'

// Importing css basic
import "../../../css/bootstrap.css";
import "../../../css/body.css";

// Importing First-section css
import "../../../css/Section/First/Apple-first-section.css";

const Apple_first_section = () => {
  return (
    <section className="first-hightlight-wrapper">
		<div className="container">

			<div className="new-alert">
				New
			</div>

			<div className="title-wraper bold black">
				iPad Pro 
			</div> 

			<div className="links-wrapper">
				<ul>
					<li><a href="/Learn more/">Learn more</a></li>
					<li><a href="/Order/">Order</a></li>
				</ul> 
			</div>

			<div className="ipod-caption row">
				<div className="col-sm-12 col-md-6 text-md-right">iPad Pro available starting 3.25</div>
				<div className="col-sm-12 col-md-6 text-md-left">Magic Keyboard coming in May</div>
			</div>
		</div>
	</section>
  )
}

export default Apple_first_section;
